import React from "react";
import "./Header.css";
import Logo from '../assets/images/logo-250symbol2.png';
import Login from "../pages/login";
import download from '../assets/images/search_filled.png';

import { Button, TextField ,Link} from "@mui/material";

function Header(){
    return(
        
        <div className="head1">
            <div className="head2">
                <div className="head3">
                    <div className="he">
                        <img src={Logo} alt="App Logo" height="72px" width="72px" />
                    </div>
                    <div className="hea">
                        <h1>Tatvasoft</h1>
                        <p>sculpting thoughts...</p>
                    </div>
                </div>
                <div className="head4">
                    <Button variant="text" className="butcolo"><Link to='/login' style={{color:"red"}}>Login</Link></Button>
                    <Button variant="text" className="butcolo"><Link to='/register' style={{color:"red"}}>Register</Link></Button>
                  
                    <Button variant="outlined" >Cart</Button>
                </div>
            </div>
            <div className="head5">
                <TextField id="outlined-basic" label="What are you looking for..." variant="outlined" size="small" style={{marginRight:"10px"}} />
                <Button variant="contained" color="success"  style={{marginRight:"10px"}} ><img src={download} alt="App Logo" height="25px" width="25px" style={{paddingRight:10}}/>Search</Button>
                <Button variant="contained" color="error">Cancel</Button>
            </div>
        </div>
        
    );
}

export default Header;
